Este soneto fue escrito por Luis de Góngora y Argote (1561-1627), uno de los máximos exponentes de la poesía barroca española. El poema es característico de su estilo más claro y directo, anterior a su período más culterano, y fue escrito probablemente a principios del siglo XVII.
